import React from 'react'

const SpeakerImage = ({details}) => {
    return (
        <div>
            <div className="mb-6">
                    <img
                        src={`/speakers/speaker-${details.id}.jpg`}
                        alt={`${details.firstName} ${details.lastName}`}
                    />
            </div>
        </div>
    )
}

export default SpeakerImage;
